  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'


export default ({components, ...props}) => <MDXTag name="wrapper"  components={components}><MDXTag name="h1" components={components} props={{"id":"class101-ui"}}>{`Class101 UI`}</MDXTag>
<MDXTag name="p" components={components}>{`Class101 UI는 리액트 프론트엔드 개발을 더 빠르고 쉽게 만들어줍니다. 또한 클래스101 프로젝트들을 위해 만들어졌습니다.`}</MDXTag>
<MDXTag name="h1" components={components} props={{"id":"quick-start"}}>{`Quick Start`}</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"install"}}>{`Install`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-console","metaString":""}}>{`npm install --save class101-ui
`}</MDXTag></MDXTag>
<MDXTag name="h2" components={components} props={{"id":"usage"}}>{`Usage`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-jsx","metaString":""}}>{`import React, { Component } from 'react';

import { Button } from 'class101-ui';

class Example extends Component {
  render () {
    return (
      <Button>
        Hello, world!
      </Button>
    )
  }
}
`}</MDXTag></MDXTag></MDXTag>
